import { connect } from 'react-redux';
import { title } from '../dashboard-data-files/CalenderData';
import { selectProjects } from '../redux/piqueTree/PiqueTree.selector';

export const width = '600px';
export const height= '400px'
export const chartType = 'LineChart'
export const showButton = true;

title ? projects[0].fileContent.name : "Total Quality Score";

export const options = {
    title: title,
    hAxis: { title: 'Version', minValue: 0, maxValue: 1 },
    vAxis: { title: 'Score', minValue: 0, maxValue: 1 },
    legend: 'none',
    colors:['#226192','#004411'],
    backgroundColor: 'white'
}

const mapStateToProps = createStructuredSelector({
    projects: selectProjects
})

export default connect(mapStateToProps)(Dashboard)
